0.ds_documentacao:
I. 01 (uma) fotocópia da Carteira de Identidade; 
II. 01 (uma) fotocópia do CPF ou Comprovante de Situação Cadastral do CPF obtido no site da Receita Federal; 
III. 01 (uma) Fotografia colorida 3X4 (de frente, recente e datada); 
IV. 01 (uma) fotocópia da Carteira de Reservista ou Certificado de Dispensa, somente para candidatos do sexo masculino; 
V. 01 (uma) fotocópia do Histórico Escolar e do Certificado de Conclusão do Ensino Médio, antigo 2º Grau; VI. 01 (uma) fotocópia do Comprovante de residência atualizado (últimos
três meses); 
VII. declaração de que não possui vínculo como aluno de outro Curso de Graduação de Instituição de Ensino Superior
Pública, incluída a própria UNEAL, em obediência à Lei nº 12.089, de 12 de novembro de 2009. 
Os documentos devem ser apresentados na forma e no prazo previstos no edital do Processo Seletivo. INSTRUÇÕES GERAIS: A matrícula dos candidatos convocados no Processo Seletivo para Ingresso nos Cursos de Graduação Presenciais da UNEAL 2020 - SiSU/MEC 2020.1, será realizada em duas etapas: 
a) Primeira Etapa - Pré-Matrícula Institucional: destina-se ao envio online da documentação exigida pelo candidato dentro da demanda que está concorrendo nos dias e horários indicados nos Editais de Convocação para a Pré-matrícula. 
b) Segunda Etapa - Confirmação da Matrícula: destina-se à apresentação pessoal do candidato e efetivação da sua matrícula por meio de assinatura na Ata de Confirmação de Matrícula nos dias, locais e horários previstos nos Editais de Convocação para a Confirmação da Matrícula. O(A) candidato(a) que não participar de qualquer uma das etapas no local, dia e horário, definidos em Edital de Convocação, será considerado(a) desistente para todos os efeitos, sendo convocado o seguinte, em conformidade com o processo classificatório. O(A) candidato(a) deverá observar as normas e procedimentos publicados nos editais do Processo Seletivo por meio do endereço eletrônico www.uneal.edu.br.

